import React from 'react'

// value и onClick  - деструктуризация props
const HintButton = ({value, onClick}) => {
  return (
    <button 
    className='waves-effect waves-light btn-small'
    onClick={onClick}
    >
      {value}
    </button>
  )
}

export default HintButton;
